commit.message:
[refact] namespace crypto alg according to support

Added dh/{stable,experimental,dangerous}
Added cipher/{stable,experimental,dangerous}
Added hash/{stable,experimental,dangerous}

where:
stable are alg. officially supported by Noise
experimental are algorithms recognized by Noise community but not offically supported
dangerous includes algorithms that might have been written by a monkey

Moved dh_nogen to dh/dangerous
Updated Readme and examples with the new structure
